INSERT INTO `t_message` VALUES ('377', '6cde819c9f914e2e8aad472af5ed1c72', 'testscrm@163.com', null, '', null, null, null, null, null, null, 'Re: 网易邮箱提醒：您邮箱的IMAP服务未开启', '', '2017-01-16 10:17:38', '0', null, '0', '1', null, null, '2017-01-18 11:19:35', '2017-01-18 11:19:35', '0', '1484098189', null, '0', '0', '1', '<p>222222</p><br/><br/><br/>2017年01月14日 15:43:14,testscrm@163.com 写到<br>><br/><br/>------------------ 原始邮件  ------------------<br/><br/><br/><br/><br/><br/><br/><meta charset=\"UTF-8\" />\r\n<table align=\"center\" bgcolor=\"#ffffff\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:598px;border:1px solid #708596;border-collapse::collapse;\">\r\n      <tbody>\r\n             <tr>\r\n                 <td><img  src=\"http://mimg.126.net/hxm/mail/edm/20141116/banner.jpg\" alt=\"网易邮箱\" border=\"0\" usemap=\"#Map\" style=\"display: block;margin-top:0;\"/></td>\r\n             </tr>\r\n             <tr height=\"566\">\r\n                <td width=\"598\">\r\n                    <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:598px;height:466px;background-color:#fefefe;font-size:14px;line-height:32px;\">\r\n                        <tr height=\"40\"><td colspan=\"3\">&nbsp;</td></tr>\r\n                        <tr height=\"34\">\r\n                            <td width=\"30\">&nbsp;</td>\r\n                            <td colspan=\"2\" width=\"568\">亲爱的 testscrm@163.com &nbsp;您好：</td>\r\n                        </tr>\r\n                        <tr height=\"34\">\r\n                            <td width=\"30\">&nbsp;</td>\r\n                            <td colspan=\"2\" width=\"548\" style=\"text-indent:30px;\">系统检测到您正在尝试使用IMAP协议访问您的邮箱，为了确保您的帐户安全，该服</td>\r\n                        </tr>\r\n                        <tr height=\"34\">\r\n                            <td width=\"30\">&nbsp;</td>\r\n                            <td colspan=\"2\" width=\"568\">务尚未开启。</td>\r\n                        </tr>\r\n                        <tr he