br />\r\n                        Bounce reason&nbsp;:\r\n                </th> \r\n        <td> \r\n            <!-- wayhome 2009-3-9 --> \r\n            <div class=\"infoTt\">收件方邮箱容量已满或者剩余空间不足以接收您发送的信件。</div> \r\n            <div class=\"infoTt\">This error indicates that the recipient\'s mailbox is full or has no enough quota space left to receive your email.</div> \r\n            <div class=\"infoDcr\">Quota error.(Quota&nbsp;exceeded)</div> \r\n        </td> \r\n    </tr> \r\n \r\n    <!-- 解决方案 --> \r\n    <tr class=\"tr_Sr\"> \r\n        <th nowrap=\"\">\r\n                        建议解决方案/\r\n                        <br />\r\n                        Proposed Solution&nbsp;:\r\n                </th> \r\n        <td> \r\n            <div>\r\n            <ul class=\"ul_lst\"> \r\n                <li>邮差温馨提示：请以其他方式通知收件人清理过期无用邮件，待对方腾出空出容量后再重新发送。/<br>Warm tips:Please call  the recipient to free up additional space and then send again.</li>\r\n                <li>如果您有其他退信问题，欢迎向客服中心联系/<br>If you have any other bounce problems, please contact customer service center</li>\r\n            </ul> \r\n            </div>        \r\n        </td> \r\n    </tr> \r\n\r\n   <!-- 退信代码 -->\r\n   <tr class=\"tr_Rz\">\r\n        <th nowrap=\"\">\r\n                        退信代码/\r\n                        <br />\r\n                        Bounce Code&nbsp;:\r\n                </th>\r\n        <td>\r\n	          <div class=\"infoDcr\">quota exceeded</div>\r\n        </td>\r\n    </tr>  \r\n</tbody></table> \r\n</div> \r\n\r\n\r\n<!-- footer -->\r\n<span>\r\n<br>----------------<br>This message is generated by Coremail.<br>您收到的是来自 Coremail 专业邮件系统的信件.<br><br>\r\n</span>\r\n\r\n\r\n\r\n<style type=\"text/css\">\r\n.netease-attDown{ width:430px;height:auto;background-color:#F6F9FC;border:#C5D2DA 1px solid;padding:12px;line-height:160%;font-size:12px;white-space:nowrap;font-family:Verdana}\r\n.netease-attDown-tit{ color:#A0A0A0 }\r\n.netease-attDown-tit strong{ color:#008000 }\r\n.netease-attD