INSERT INTO `t_message` VALUES ('467', '6cde819c9f914e2e8aad472af5ed1c72', 'mail@service.netease.com', null, '网易邮件中心', null, null, null, null, null, null, '网易邮箱提醒：阻止了一次不安全的收信请求', '', '2017-01-11 11:01:58', '0', null, '0', '1', null, null, '2017-01-18 11:20:02', '2017-01-18 11:20:02', '0', '1484098186', null, '0', '0', '1', '<meta charset=\"UTF-8\" />\r\n<table align=\"center\" bgcolor=\"#f1f1f1\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:600px;\">\r\n    <tbody>\r\n        <tr height=\"70\">\r\n            <td width=\"100%\">\r\n                <img src=\"http://mimg.126.net/hxm/mail/edm/20141128/logo.jpg\" alt=\"网易邮箱\" border=\"0\" usemap=\"#Map\" style=\"border:0;margin:auto 16px;\"/>            </td>\r\n        </tr>\r\n        <tr height=\"482px\">\r\n            <td width=\"600\">\r\n                <div style=\"margin:0;padding;0;border:0;width:566px;height:480px;margin-left:17px;background-color:#fff;border:1px solid #eaeaea;\">\r\n                    <p style=\"margin:0;padding:0;border:0;margin:28px 0 28px 36px;font-size:12px;color:#2a2a2a;line-height:12px;font-family:Simsum;\">尊敬的 testscrm@163.com &nbsp;您好！</p>\r\n                    <p style=\"margin:0;padding:0;border:0;font-size:12px;color:#2a2a2a;line-height:12px;font-family:Simsum;text-indent:36px;\">我们最近阻止了一次试图收取您网易邮箱帐户 testscrm@163.com 内邮件的行为。</p>\r\n                    <p style=\"margin:0;padding:0;border:0;margin-top:10px;text-indent:36px;font-size:12px;color:#c30000;line-height:19px;font-family:Simsum;font-weight:bold;\">该行为存在以下安全隐患：</p>\r\n                    <p style=\"margin:0;padding:0;border:0;text-indent:36px;font-size:12px;color:#c30000;line-height:19px;font-family:Simsum;\">1） 邮件客户端未经有效识别，不能有效保证帐户安全性，存在帐号密码泄漏的风险；</p>\r\n                    <p style=\"margin:0;padding:0;border:0;text-indent:36px;font-size:12px;color:#c30000;line-height:19px;font-family:Simsum;\">2） 数据传输安全性低，存在数据泄漏风险。</p>\r\n                    <p style=\"margin:0;padding:0;border:0;margin:28px 0 8px 36px;font-size:12px;color:#2a2a2a;line-height:20px;font-family:Simsum;font-weight:bold;\">如果这不是您本人所为</p>\r\n                    <p style=\"margin:0;padding:0;border:0;font-size:12px;color:#2a2a2a;line-height:20px;font-family:Simsum;text-indent:36px;\">请通过<a href=\"http://reg.163.com/userLoginInfo.jsp?username=testscrm@163.com\" target=\"_blank\" style=\"color:#0066cc;text-decoration:none;\">http://reg.163.com/userLoginInfo.jsp?username=testscrm@163.com</a>查看“帐户</p>\r\n                    <p style=\"margin:0;padding:0;border:0;font-size:12px;color:#2a2a2a;line-height:20px;font-family:Simsum;text-indent:36px;\">登录信息”页面，以确定是否存在任何可疑活动。</p>\r\n                    <p style=\"margin:0;padding:0;border:0;margin:28px 0 8px 36px;font-size:12px;color:#2a2a2a;line-height:20px;font-family:Simsum;font-weight:bold;\">如果这是您本人所为</p>\r\n                    <p style=\"margin:0;padding:0;border:0;font-size:12px;color:#2a2a2a;line-height:20px;font-family:Simsum;text-indent:36px;\">推荐您改用网易邮箱开发的移动客户端应用（<a href=\"http://mail.163.com/client/dl.html?from=mail12\" target=\"_blank\" style=\"color:#0066cc;\">邮箱大师</a>）或者使用其他正规厂商的客户端访问</p>\r\n                    <p style=\"margin:0;padding:0;border:0;font-size:12px;color:#2a2a2a;line-height:20px;font-family:Simsum;text-indent:36px;\">您的帐户。</p>\r\n                    <p style=\"margin:0;padding:0;border:0;font-size:12px;color:#2a2a2a;line-height:20px;font-family:Simsum;text-indent:36px;\">如您确认当前所用的邮件客户端为可信任客户端仍继续使用，并愿自行承担信息泄</p>\r\n                    <p style=\"margin:0;padding:0;border:0;font-size:12px;color:#2a2a2a;line-height:20px;font-family:Simsum;text-indent:36px;\">露风险和损失，可前往（<a href=\"http://config.mail.163.com/settings/imap/index.jsp?uid=testscrm@163.com\" target=\"_blank\" style=\"color:#0066cc;\">这里</a>）设置。</p>\r\n                    <p style=\"margin:0;padding:0;border:0;font-size:12px;color:#2a2a2a;line-height:20px;font-family:Simsum;text-indent:36px;\">了解更多详情，请参见<a href=\"http://mail.163.com/html/notice/2014/notice_1201.htm\" target=\"_blank\" style=\"color:#0066cc;text-decoration:none;\">《网易邮箱公告》</a>。</p>\r\n                    <p style=\"margin:0;padding:0;border:0;margin-top:20px;font-size:12px;color:#2a2a2a;line-height:20px;font-family:Simsum;text-indent:36px;\">此致</p>\r\n                    <p style=\"margin:0;padding:0;border:0;font-size:12px;color:#2a2a2a;line-height:20px;font-family:Simsum;text-indent:36px;\">网易邮件中心&nbsp;敬上</p>\r\n                    <p style=\"margin:0;padding:0;border:0;font-size:12px;color:#2a2a2a;line-height:20px;font-family:Simsum;text-indent:36px;\"> 2017年01月</p>\r\n                </div>\r\n            </td>\r\n        </tr>\r\n        <tr height=\"44\"><td>&nbsp;</td></tr>\r\n        <tr height=\"110\">\r\n            <td>\r\n                <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:600px;height:110px;\">\r\n                    <tr>\r\n                        <td width=\"54\">&nbsp;</td>\r\n                        <td width=\"110\">\r\n                            <img src=\"http://mimg.126.net/hxm/mail/edm/20141128/erweima.jpg\" alt=\"扫一扫二维码\"  style=\"border:0;\"/>\r\n                        </td>\r\n                        <td width=\"16\">&nbsp;</td>\r\n                        <td width=\"420\" style=\"vertical-align:top;\">\r\n                            <p style=\"margin:0;padding:0;border:0;font-size:16px;font-weight:bold;color:#2a2a2a;line-height:16px;\">邮箱大师</p>\r\n                            <p style=\"margin:0;padding:0;border:0;margin-top:7px;font-size:12px;line-height:20px;font-family:Simsum;\">支持所有邮箱、最快新邮件提醒、图片附件压缩快速收发节省流量、手势密<br />码等多重安全保障。</p>\r\n                            <p style=\"margin:0;padding:0;border:0;margin-top:7px;\"><a href=\"http://u.163.com/iosds12\" target=\"_blank\" style=\"outline:none; border:0px;\" ><img src=\"http://mimg.126.net/hxm/mail/edm/20141128/iphone.jpg\" alt=\"苹果设备下载\" style=\"border:0;\"/></a><a href=\"http://u.163.com/androidds12\" target=\"_blank\" style=\"outline:none; border:0px;margin