-- ----------------------------
-- Table structure for t_contacts_company
-- ----------------------------
DROP TABLE IF EXISTS `t_contacts_company`;
CREATE TABLE `t_contacts_company` (
  `ID` varchar(36) NOT NULL COMMENT '主键ID',
  `USER_ID` varchar(36) NOT NULL COMMENT '用户ID',
  `AVATAR` varchar(200) DEFAULT NULL COMMENT '头像图片',
  `NAME` varchar(100) NOT NULL COMMENT '公司名称',
  `URL` varchar(100) DEFAULT NULL COMMENT '公司网站',
  `TELEPHONE` varchar(1000) DEFAULT NULL COMMENT '电话（json格式[{电话类型，电话号码，排序值}]），电话类型：0、主要；1、工作；2、手机；3、家庭；4、工作传真；5、家庭传真；6、其他',
  `MAIL` varchar(100) DEFAULT NULL COMMENT 'mail（默认邮箱）',
  `ADDRESS` varchar(1000) DEFAULT NULL COMMENT '地址(json格式[{地址类型，详细地址，市，州，国家，邮编，排序值}])，地址类型：0、工作；1、家庭；2、其他',
  `TYPE` varchar(50) DEFAULT NULL COMMENT '联系人类型数据字典码。值： 客户、竞争对手、投资者、领导、内部员工、合作伙伴、新闻、潜在客户、经销商、其他',
  `STAGE` varchar(50) DEFAULT NULL COMMENT '阶段数据字典码。值：潜在、意向、跟进、样品、成功、失败',
  `SOURCE` varchar(50) DEFAULT NULL COMMENT '来源数据字典码。值：阿里巴巴、电话来访、老客户、客户介绍、独立开发、媒体宣传、促销活动、代理商、合作伙伴、公开招标、直邮、Email群发、网站、会议、口碑、其他',
  `INCOME` bigint(20) NOT NULL DEFAULT '0' COMMENT '年收入(以分为单元,币种是人民币)',
  `INCOME_CURRENCY` varchar(50) DEFAULT NULL COMMENT '年收入币种数据字典码(US是美元,CNY是人民币)',
  `COMPANY_SIZE` varchar(50) DEFAULT NULL COMMENT '员工数量',
  `MESSAGE_ID` bigint(20) NOT NULL DEFAULT '0' COMMENT '最后消息行为ID,没有消息则为0',
  `LAST_ACTION` varchar(500) DEFAULT NULL COMMENT '最后消息行为内容',
  `LAST_ACTION_TIME` timestamp NULL DEFAULT NULL COMMENT '最后消息行为时间',
  `MESSAGE_IS_MAJOR` tinyint(4) NOT NULL DEFAULT '0' COMMENT '行为消息是否重要标识 （0：正常 1：重要。默认为0）',
  `MESSAGE_IS_READ` tinyint(4) NOT NULL DEFAULT '0' COMMENT '行为消息是否已读标识 （0：未读 1：已读。默认为0）',
  `LAST_CONTACT_TIME` timestamp NULL DEFAULT NULL COMMENT '最近联系时间',
  `SCORE` varchar(50) DEFAULT NULL COMMENT '分值',
  `CREATE_SOURCE` varchar(50) NOT NULL COMMENT '联系人的创建来源数据字典码。值：推荐加入、搜索加入、新建加入、社交展示条加入、手动导入、社交导入，其他',
  `CREATE_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `UPDATE_TIME` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `DELETE_TAG` tinyint(4) NOT NULL DEFAULT '0' COMMENT '删除标记：0、未删除；1、删除',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='联系公司表';

