DROP TABLE IF EXISTS `t_contacts_info_flow`;
CREATE TABLE `t_contacts_info_flow` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `PARENT_ID` bigint(20) NOT NULL DEFAULT '-1' COMMENT '父级ID (-1:初始原文)',
  `USER_ID` varchar(36) DEFAULT NULL COMMENT '用户ID',
  `SOCIAL_ACCOUNT_TYPE` tinyint(4) NOT NULL DEFAULT '0' COMMENT '社交网站类型 (0:facebook个人,1:facebook公共,2:twitter,3:linkedIn,4:linkedIn公司)',
  `SENDER_SOCIAL_ACCOUNT_ID` varchar(50) NOT NULL COMMENT '发件人在社交网上的唯一标识',
  `SENDER_SOCIAL_NAME` varchar(50) NOT NULL COMMENT '发件人在社交网上的名称',
  `SENDER_SOCIAL_AVATAR` varchar(100) NOT NULL COMMENT '发件人在社交网上的头像',
  `SOCIAL_CONTENT_ID` varchar(50) DEFAULT NULL COMMENT '社交网内容ID',
  `SOCIAL_CONTENT_PARENT_ID` varchar(50) DEFAULT NULL COMMENT '社交网内容父ID',
  `SOCIAL_CONTENT` varchar(500) DEFAULT NULL COMMENT '社交网内容',
  `SOCIAL_CONTENT_IMAGE` varchar(1000) DEFAULT NULL COMMENT '内容图片，多张图片用","号隔开',
  `SOCIAL_CONTENT_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '发表内容时间',
  `CONTENT_TYPE` tinyint(4) NOT NULL DEFAULT '0' COMMENT '文章内容类型， 0、原文；1、分享/转发文；2、评论文；3、留言文；4、私信',
  `SHARE_TYPE` tinyint(4) NOT NULL DEFAULT '0' COMMENT '文章分享/转发至目的地的类型；0:facebook个人,1:facebook公共,2:twitter,3:linkedIn,4:linkedIn公司',
  `LIKE_COUNT` int(10) NOT NULL DEFAULT '0' COMMENT '点赞数',
  `PERMISSION` varchar(50) DEFAULT NULL COMMENT '分享/转发文的查看权限',
  `CRAWL_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '数据抓取时间',
  `CREATE_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `UPDATE_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `DELETE_TAG` tinyint(4) NOT NULL DEFAULT '0' COMMENT '删除标记：0、未删除；1、删除',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='联系人/公司信息流主表';

