  `RELATE_PERSON_NAME` varchar(100) DEFAULT NULL COMMENT '相关人 名字',
  `RELATE_COMPANY` varchar(50) DEFAULT NULL COMMENT '相关公司 ID ',
  `RELATE_COMPANY_NAME` varchar(100) DEFAULT NULL COMMENT '相关公司 名字 ',
  `OTHER_RELATE_PERSON` varchar(200) DEFAULT NULL COMMENT '其他相关人ID 多个以逗号分隔',
  `DEAL_DESC` varchar(500) DEFAULT NULL COMMENT '描述',
  `CREATE_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `UPDATE_TIME` timestamp NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `DELETE_TAG` tinyint(4) DEFAULT '0' COMMENT '删除标记',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=110 DEFAULT CHARSET=utf8 COMMENT='商机表';

