  `SOCIAL_ACCOUNT_ID` varchar(50) NOT NULL DEFAULT '' COMMENT '社交平台账号id',
  `SOCIAL_CONTENT_ID` varchar(50) NOT NULL DEFAULT '' COMMENT '社交平台消息内容ID',
  `PARENT_ID` bigint(20) NOT NULL DEFAULT '-1' COMMENT '父级ID -1:初始原文',
  `SOCIAL_ACCOUNT_TYPE` tinyint(4) NOT NULL DEFAULT '0' COMMENT '来源平台 0：facebook个人 1：facebook公共 2：twitter 3:linkedIn 4：LinkedIn公司',
  `TOP_LEVEL_ID` bigint(20) NOT NULL DEFAULT '-1' COMMENT '评论的顶层ID（初始原文）',
  `HOME_TYPE` tinyint(4) NOT NULL DEFAULT '0' COMMENT '数据类型 0：原文  1：评论文',
  `IS_LIKE` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否点赞  0:否  1:是  oldColumn:HOME_STATUS',
  `IS_SHARED` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0:非 1：是',
  `SHARE_SOCIAL_ACCOUNT_ID` varchar(50) DEFAULT NULL COMMENT '对应社交平台转发者账号ID',
  `SHARE_SOCIAL_CONTENT_ID` varchar(50) DEFAULT NULL COMMENT '对应社交平台转发者消息内容ID',
  `SHARE_NAME` varchar(50) DEFAULT NULL COMMENT '转发原文作者',
  `SHARE_AVATAR` varchar(50) DEFAULT NULL COMMENT '转发原文作者头像',
  `SHARE_CONTENT` varchar(2000) DEFAULT NULL COMMENT '转发原文内容',
  `SHARE_IMAGES` varchar(1000) DEFAULT NULL COMMENT '转发原文图片、多张图片‘;’隔开',
  `SHARE_TIME` timestamp NULL DEFAULT NULL COMMENT '转发文发送时间',
  `SENDER` varchar(50) NOT NULL COMMENT '发件人',
  `AVATAR` varchar(50) NOT NULL COMMENT '发件人头像',
  `CONTENT` varchar(2000) DEFAULT NULL COMMENT '消息内容',
  `IMAGES` varchar(1000) DEFAULT NULL COMMENT '原文图片、多张图片‘;’隔开',
  `SPIDER_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '数据抓取时间',
  `SEND_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '评论、文章实际发送时间',
  `CREATE_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `UPDATE_TIME` timestamp NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP,
  `DELETE_TAG` tinyint(4) NOT NULL DEFAULT '0',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='我的个人主页表';

