-- ----------------------------
-- Table structure for t_message
-- ----------------------------
DROP TABLE IF EXISTS `t_message`;
CREATE TABLE `t_message` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `USER_ID` varchar(36) DEFAULT NULL,
  `SENDER_ID` varchar(50) NOT NULL COMMENT '发件人账号',
  `SENDER_AVATAR` varchar(150) DEFAULT NULL,
  `SENDER_NAME` varchar(50) DEFAULT NULL COMMENT '发件人名字',
  `RECEIVER_ID` varchar(200) DEFAULT NULL COMMENT '收件人账号  多个以逗号分隔',
  `RECEIVER_NAME` varchar(200) DEFAULT NULL COMMENT '收件人名字  多个以逗号分隔',
  `SECRETER_ID` varchar(200) DEFAULT NULL COMMENT '秘送人ID 	多个以逗号分隔',
  `SECRETER_NAME` varchar(200) DEFAULT NULL COMMENT '秘送人名字 	多个以逗号分隔',
  `COPYER_ID` varchar(200) DEFAULT NULL COMMENT '抄送人ID 	多个以逗号分隔',
  `COPYER_NAME` varchar(200) DEFAULT NULL COMMENT '抄送人名字 	多个以逗号分隔',
  `TOPIC` varchar(200) DEFAULT NULL COMMENT '消息主题',
  `CONTENT` text COMMENT '消息内容',
  `MESSAGE_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '消息发生时间',
  `SOURCE` tinyint(4) DEFAULT NULL COMMENT '消息来源（0：MAIL 1：FACEBOOK个人 2：FACEBOOK公共 3：TWITTER  4: TWITTER 私信 5：LINKEDIN）',
  `ACTION_TYPE` tinyint(4) DEFAULT NULL COMMENT '息操作类型 （0：正常回复   1：转发   2：私信）',
  `IS_MAJOR` tinyint(4) DEFAULT '0' COMMENT '消息是否重要标识 （0：正常 1：重要）',
  `IS_READ` tinyint(4) DEFAULT '1' COMMENT '消息是否已读标识 （0：未读 1：已读）	',
  `IS_RECYCLE` tinyint(4) DEFAULT '0' COMMENT '消息是否放入回收站标识 （0：未放入 1：放入回收站）',
  `LAST_ID` bigint(20) DEFAULT NULL COMMENT '上一消息ID',
  `CREATE_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `UPDATE_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `DELETE_TAG` tinyint(4) DEFAULT '0' COMMENT '删除标记',
  `SOCIAL_ID` varchar(50) DEFAULT NULL COMMENT '消息在社交平台的唯一标识',
  `PHOTO_URLS` varchar(1000) DEFAULT NULL COMMENT '推文的元信息',
  `USER_TYPE` tinyint(4) DEFAULT NULL COMMENT '0:收件人；1：抄送人；2：秘送人；3：发件人',
  `MAIL_TYPE` tinyint(4) DEFAULT NULL COMMENT '0 收件箱、1 发件箱、2 回收站',
  `MAIL_BINDING_ID` bigint(20) DEFAULT NULL COMMENT '同步时绑定的社交账号ID',
  `CONTENT_HTML` text COMMENT '内容 HTML格式',
  `CONVERSATION_ID` varchar(100) DEFAULT NULL COMMENT 'FACEBOOK 消息会话ID',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=633 DEFAULT CHARSET=utf8 COMMENT='消息表';

