DROP TABLE IF EXISTS `t_social_homepage_news`;
CREATE TABLE `t_social_homepage_news` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `ORIGINAL_ID` bigint(20) DEFAULT NULL COMMENT '消息原文关联ID (数据中心id,保留)',
  `SENDER_USER_ID` varchar(36) DEFAULT NULL COMMENT '系统用户ID(发送人)',
  `RECEIVE_CONTACTS_ID` varchar(36) DEFAULT NULL COMMENT '联系人ID(接收人)',
  `RECEIVE_CONTACTS_TYPE` tinyint(4) DEFAULT '0' COMMENT '联系人类型；0、个人；1、公司',
  `PARENT_ID` bigint(20) NOT NULL DEFAULT '-1' COMMENT '父级ID (-1:初始原文)',
  `TOP_LEVEL_ID` bigint(20) NOT NULL DEFAULT '-1' COMMENT '评论的顶层ID(初始原文ID) -1:表示非评论',
  `IS_COMMENT` tinyint(20) NOT NULL DEFAULT '0' COMMENT '是否为评论文 (0:原文 1:评论文)',
  `SOCIAL_ACCOUNT_TYPE` tinyint(4) NOT NULL DEFAULT '0' COMMENT '社交账号类型(0:facebook个人,1:facebook公共,2:twitter,3:linkedIn,4:linkedIn公司)',
  `SOCIAL_ACCOUNT_ID` varchar(50) NOT NULL COMMENT '发件人在社交网上的唯一标识',
  `SOCIAL_CONTENT_ID` varchar(50) DEFAULT NULL COMMENT '社交网内容ID',
  `SENDER_NAME` varchar(50) NOT NULL COMMENT '发件人在社交网上的名称',
  `SENDER_SCREEN_NAME` varchar(50) NOT NULL COMMENT '发件人@唯一名称',
  `SENDER_AVATAR` varchar(100) NOT NULL COMMENT '发件人在社交网上的头像',
  `SOCIAL_CONTENT_PARENT_ID` varchar(50) DEFAULT '' COMMENT '社交网内容父ID',
  `CONTENT` varchar(2000) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '社交网内容',
  `IMAGES` varchar(1000) DEFAULT NULL COMMENT '内容图片，多张图片用";"号隔开',
  `SCREEN_NAME_LIST` varchar(2000) DEFAULT NULL COMMENT '@名称及对应社交ID [{"soicalId":"123","screanName":"@jrx1"}]',
  `IS_SHARED` tinyint(4) NOT NULL DEFAULT '0' COMMENT '如果属于原文，原文文章类型 0：原创文 1：转发文',
  `SHARE_TYPE` tinyint(4) DEFAULT '0' COMMENT '文章分享/转发至目的地的类型；0:facebook个人,1:facebook公共,2:twitter,3:linkedIn,4:linkedIn公司',
  `LIKE_COUNT` int(10) NOT NULL DEFAULT '0' COMMENT '点赞数量',
  `PERMISSION` varchar(50) DEFAULT NULL COMMENT '分享/转发查看权限',
  `SHARE_SOCIAL_ACCOUNT_ID` varchar(50) DEFAULT NULL COMMENT '对应社交平台转发者账号ID',
  `SHARE_SOCIAL_CONTENT_ID` varchar(50) DEFAULT NULL COMMENT '对应社交平台转发者消息内容ID',
  `SHARE_NAME` varchar(50) DEFAULT NULL COMMENT '转发原文作者',
  `SHARE_SCREEN_NAME` varchar(50) DEFAULT NULL COMMENT '转发原文作者@唯一名称',
  `SHARE_AVATAR` varchar(100) DEFAULT NULL COMMENT '转发原文头像',
  `SHARE_CONTENT` varchar(2000) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '转发原文内容',
  `SHARE_SCREEN_NAME_LIST` varchar(2000) DEFAULT NULL COMMENT '转发原文 @名称及对应社交ID [{"soicalId":"123","screanName":"@jrx1"}]',
  `SHARE_IMAGES` varchar(1000) DEFAULT NULL COMMENT '转发原文图片、多张图片‘;’隔开',
  `SHARE_TIME` timestamp NULL DEFAULT NULL COMMENT '转发原文发送时间',
  `SEND_TIME` timestamp NULL DEFAULT NULL COMMENT '评论、文章实际发送时间',
  `CRAWL_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '数据抓取时间',
  `CREATE_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `UPDATE_TIME` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `DELETE_TAG` tinyint(4) NOT NULL DEFAULT '0' COMMENT '删除标记：0、未删除；1、删除',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=369 DEFAULT CHARSET=utf8 COMMENT='社交主页信息表(信息流)';

