  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `TASK_CODE` varchar(50) NOT NULL COMMENT '任务代码',
  `LAST_EXECUTE_TIME` timestamp NULL DEFAULT NULL COMMENT '任务最近执行时间',
