-- ----------------------------
-- Table structure for t_user
-- ----------------------------
DROP TABLE IF EXISTS `t_user`;
CREATE TABLE `t_user` (
  `ID` varchar(36) NOT NULL COMMENT '主键ID',
  `LOGIN_ACCOUNT` varchar(50) NOT NULL COMMENT '用户名(手机号注册)',
  `LOGIN_PASSWORD` varchar(64) NOT NULL COMMENT '用户密码编码后的值(用户密码加盐值然后编码生成)',
  `SALT` char(6) NOT NULL COMMENT '密码盐',
  `REG_SOURCE` char(6) NOT NULL COMMENT '0=PC，1=嵌入端，2=移动H5，3=安卓，4=iOS',
  `REG_IP` bigint(20) DEFAULT NULL COMMENT '注册IP',
  `REGISTRATION_ID` varchar(500) DEFAULT NULL COMMENT '用户设备标识',
  `NAME` varchar(50) NOT NULL COMMENT '姓名',
  `AVATAR` varchar(50) DEFAULT '' COMMENT '图像',
  `TYPE` tinyint(4) NOT NULL DEFAULT '0' COMMENT '账号类型(0:父账号，1:子账号)',
  `PARENT_USER_ID` varchar(36) NOT NULL DEFAULT '-1' COMMENT '-1则是父账号ID，否则子账号ID',
  `POSITION` varchar(50) DEFAULT '' COMMENT '职位',
  `TELEPHONE` varchar(36) DEFAULT '' COMMENT '电话',
  `MAIL` varchar(50) DEFAULT '' COMMENT '邮箱',
  `REG_COMPANY` varchar(100) NOT NULL COMMENT '注册公司',
  `COUNTRY_ID` varchar(36) DEFAULT '' COMMENT '国家ID',
  `COUNTRY_NAME` varchar(50) DEFAULT '' COMMENT '国家名',
  `COUNTRY_NAME_EN` varchar(50) DEFAULT '' COMMENT '国家英文名',
  `PROVINCE_ID` varchar(36) DEFAULT '' COMMENT '省ID',
  `PROVINCE_NAME` varchar(30) DEFAULT '' COMMENT '省名称',
  `PROVINCE_NAME_EN` varchar(50) DEFAULT '' COMMENT '省英文名',
  `CITY_ID` varchar(36) DEFAULT '' COMMENT '城市ID',
  `CITY_NAME` varchar(30) DEFAULT '' COMMENT '城市名称',
  `CITY_NAME_EN` varchar(50) DEFAULT '' COMMENT '市英文名',
  `ADDRESS` varchar(200) DEFAULT '' COMMENT '详细地址',
  `POSTCODE` varchar(10) DEFAULT '' COMMENT '邮编',
  `TIME_ZONE_ID` int(10) DEFAULT NULL COMMENT '时区ID',
  `TIME_ZONE` varchar(50) DEFAULT '' COMMENT '时区',
  `CREATE_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `UPDATE_TIME` timestamp NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `DELETE_TAG` tinyint(4) NOT NULL DEFAULT '0' COMMENT '删除标记：0、未删除；1、删除',
  `ACCOUNT_STATUS` tinyint(4) NOT NULL DEFAULT '0' COMMENT '账号的状态(0:待激活;1:正常;2:过期(订阅);3:禁用)',
  `IS_FIRST_LOGIN` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否第一次登录（1:是,0:否)',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of t_user
-- ----------------------------

