-- ----------------------------
-- Table structure for t_user_company
-- ----------------------------
DROP TABLE IF EXISTS `t_user_company`;
CREATE TABLE `t_user_company` (
  `ID` varchar(36) NOT NULL COMMENT '主键ID',
  `USER_ID` varchar(36) NOT NULL COMMENT '用户ID',
  `REG_COMPANY` varchar(100) NOT NULL COMMENT '注册公司',
  `LOGO_URL` varchar(100) DEFAULT '' COMMENT '公司logo',
  `CONTACT_MAIL` varchar(36) DEFAULT '' COMMENT '公司邮箱',
  `BUSINESS_NATURE` varchar(50) DEFAULT '' COMMENT '企业性质',
  `BUSINESS_SCOPE` varchar(100) DEFAULT NULL COMMENT '经营范围',
  `REGISTERED_CAPITAL` bigint(20) DEFAULT '0' COMMENT '注册资金(以分为单元,币种是人民币)',
  `CURRENCY` varchar(20) DEFAULT '' COMMENT '金额币种CODE(US是美元,CNY是人民币)',
  `FIRM_SIZE` varchar(20) DEFAULT '' COMMENT '公司规模',
  `FOUND_DATE` varchar(20) DEFAULT '' COMMENT '成立日期',
  `BUSINESS_AREA` varchar(36) DEFAULT '' COMMENT '业务区域(对应国家ID)',
  `BUSINESS_ADDRESS` varchar(200) DEFAULT '' COMMENT '公司地址',
  `CONTACT_PHONE` varchar(50) DEFAULT '' COMMENT '联系人手机',
  `COMP_DESC` varchar(2000) DEFAULT '' COMMENT '公司简介',
  `CREATE_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `UPDATE_TIME` timestamp NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `DELETE_TAG` tinyint(4) NOT NULL DEFAULT '0' COMMENT '删除标记：0、未删除；1、删除',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户所属公司信息表';

